        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome characterized by childhood onset of progressive neuroophthalmic manifestation including optic atrophy, mixed polyneuropathy, spinal and cerebellar ataxia and generalized chorea that has_material_basis_in homozygous mutation in the POLG2 gene on chromosome 17q23." ;
    :has_exact_match "OMIM:619425" ;
    :has_exact_synonym "mitochondrial DNA depletion syndrome 16B (neuroophthalmic type)" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
