        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome characterized by childhood onset of encephalopathy, stroke-like episodes, lactic acidosis, hypocitrullinemia, and multiple mitochondrial oxidative phosphorylation deficiencies that has_material_basis_in homozygous mutation in the MRM2 gene on chromosome 7p22.3. Phenotype is similar to MELAS syndrome." ;
    :has_exact_match "OMIM:618567" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
