            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :chromosomal_duplication_syndrome ;
    :has_definition "A chromosomal duplication syndrome characterized by cardiomyopathy, corneal clouding or cataracts, hyperlactacidemia, and perinatal death that has_material_basis_in heterozygous duplication within the ATAD3 gene cluster, including the ATAD3A, ATAD3B, and ATAD3C genes, on chromosome 1p36.33 resulting in ATAD3A/ATAD3C gene fusion. Hypotonia, encephalopathy, seizures, and white matter abnormalities are also common." ;
