        "UMLS_CUI:C5394150" ;
    :has_exact_synonym "CHROMOSOME 1p36.33 DUPLICATION SYNDROME, ATAD3 GENE CLUSTER, AUTOSOMAL DOMINANT" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
