@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:borrelia_miyamotoi_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :tick_borne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :borrelia_miyamotoi ],
        [ owl:unionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :transmitted_by ;
                            owl:someValuesFrom :ixodes_pacificus ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :transmitted_by ;
                                    owl:someValuesFrom :ixodes_ricinus ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :transmitted_by ;
                                            owl:someValuesFrom :ixodes_persulcatus ] ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :transmitted_by ;
                                                    owl:someValuesFrom :ixodes_scapularis ] ;
                                            rdf:rest :nil ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :asthenia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_pain ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that has_material_basis_in Borrelia miyamotoi, which is transmitted_by the blacklegged tick (Ixodes scapularis), the western blacklegged tick (Ixodes pacificus), the taiga tick (Ixodes persulcatus), or the castor bean tick (Ixodes ricinus). The infection has_symptom fever, headache, chills, muscle pain, joint pain, asthenia, fatigue and nausea, and rarely relapses." ;
    :has_exact_match "SNOMEDCT_US_2023_03_01:713014002",
        "UMLS_CUI:C4076531" ;
    :has_exact_synonym "BMD",
        "hard tick-borne relapsing fever" .

