            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :adult_respiratory_distress_syndrome ],
        [ owl:unionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :transmitted_by ;
                            owl:someValuesFrom :contact_transmission ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :transmitted_by ;
                                    owl:someValuesFrom :droplet_spread_transmission ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :transmitted_by ;
                                            owl:someValuesFrom :vehicle_borne_fomite_transmission ] ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :transmitted_by ;
                                                    owl:someValuesFrom :vehicle_borne_ingestion_transmission ] ;
                                            rdf:rest :nil ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :burkholderia_cepacia_complex ],
        :opportunistic_bacterial_infectious_disease ;
    :has_definition "An opportunistic bacterial infectious disease characterized by necrotizing pneumonia, acute respiratory distress syndrome, and bacteremia that has_material_basis_in Burkholderia cepacia complex, which is transmitted_by contact transmission, droplet spread transmission, vehicle-borne fomite transmission, and vehicle-borne ingestion transmission." ;
    :has_exact_synonym "CS" .

