    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :bone_element ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A connective tissue disease that affects the structure or development of bone or causes an impairment of normal bone function." ;
    :has_related_synonym "skeletal disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bone_remodeling_disease rdfs:subClassOf :bone_disease ;
    :has_definition "A bone disease that results_in formation or resorption abnormalities located_in bone." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bone_development_disease rdfs:subClassOf :bone_disease ;
    :has_definition "A bone disease that results_in abnormal growth and development located_in bone or located_in cartilage." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

