            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :bone_element ],
        :bone_structure_disease ;
    :has_definition "A bone structure disease that results_in change or damage of structure located_in bone." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ischemic_bone_disease rdfs:subClassOf :bone_disease ;
    :has_definition "A bone disease that results_in an interruption of blood supply located_in bone." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_dominant_disease rdfs:subClassOf :x_linked_monogenic_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :x_linked_dominant_inheritance ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A X-linked monogenic disease that has_material_basis_in dominant inheritance." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

