            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_bone_structure ],
        :bone_disease ;
    :has_definition "A bone disease that has_material_basis_in an abnormality in the location or function of the skeletal structure." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bone_resorption_disease rdfs:subClassOf :bone_remodeling_disease ;
    :has_definition "A bone remodeling disease that results in an abnormal decrease of bone density or mass." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_recessive_disease rdfs:subClassOf :x_linked_monogenic_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :x_linked_recessive_inheritance ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A X-linked monogenic disease that has_material_basis_in recessive inheritance." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chromosomal_disease rdfs:subClassOf :genetic_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :chromosome_structure_variation ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A genetic disease that has_material_basis_in extra, missing, or re-arranged chromosomes." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:physical_disorder rdfs:subClassOf :disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_basis_in ;
                                    owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A disease that has_material_basis_in a genetic abnormality, error with embryonic development, infection or compromised intrauterine environment." ;
    :has_exact_synonym "congenital disorder" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spina_bifida rdfs:subClassOf :neural_tube_defect ;
    :has_definition "A neural tube defect that is characterized by incomplete closing of the spine and membranes around the spinal cord during early development." ;
    :has_exact_match "MESH:D016135",
        "NCI:C101214" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dysbaric_osteonecrosis rdfs:subClassOf :ischemic_bone_disease ;
    :has_definition "An ischemic bone disease the has_material_basis_in nitrogen embolization located_in bone." ;
    :has_exact_synonym "Caisson disease of bone"@en,
        "DON"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:metaphyseal_dysplasia rdfs:subClassOf :osteochondrodysplasia ;
    :has_definition "An osteochondrodysplasia that is characterized by abnormally broad ends of the arm and leg long bones resembling a boat oar or paddle due to enlargement of the spongy inner layer of bone." ;
    :has_exact_synonym "Bakwin-Krida syndrome"@en,
        "Pyle's disease"@en,
        "Pyle-Cohn syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:jansen_s_metaphyseal_chondrodysplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :disproportionate_short_limb_short_stature ],
        :autosomal_dominant_disease,
        :metaphyseal_dysplasia ;
    :has_definition "A metaphyseal dysplasia that has_material_basis_in mutation in PTH receptor which results_in short-limbed dwarfism." ;
    :has_exact_synonym "Jansen Disease"@en,
        "Jansen Metaphyseal Dysostosis"@en,
        "Jansen metaphyseal chondrodysplasia"@en,
        "Murk Jansen Type Metaphyseal Chondrodysplasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

