            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :severe_short_stature ],
        :metaphyseal_dysplasia ;
    :has_definition "A metaphyseal dysplasia that results_in dwarfism and bowed legs." ;
    :has_exact_synonym "Japanese type spondylometaphyseal dysplasia"@en,
        "Schmid type metaphyseal dysplasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

