            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :epiphysis ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :platyspondyly ],
        :autosomal_recessive_disease,
        :osteochondrodysplasia ;
    :has_definition "An osteochondrodysplasia that results from mutations autosomal recessive inheritance of mutations in the COL11A2 gene which results_in enlargement of the located_in epiphysis in located_in hand and located_in foot, distinct facial features, platyspondyly and hearing loss." ;
    :has_exact_synonym "OSMEDB",
        "CHONDRODYSTROPHY WITH SENSORINEURAL DEAFNESS"@en,
        "NANCE-INSLEY SYNDROME"@en,
        "NANCE-SWEENEY CHONDRODYSPLASIA"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

