            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :epiphysis ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :metaphysis ],
        :osteochondrodysplasia,
        :spinal_disease ;
    :has_definition "An osteochondrodysplasia that results_in abnormalities of bone growth located_in vertebral column, located_in epiphysis, located_in metaphysis." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

