            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :vertebral_column ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :genu_varum ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :pear_shaped_vertebrae ],
        :autosomal_dominant_disease,
        :spondyloepimetaphyseal_dysplasia ;
    :has_definition "A spondyloepimetaphyseal dysplasia that has_material_basis_in mutations in the MMP13 gene which results_in a pear-shaped vertebrae, abnormal metaphyseal changes, and genu varum deformities." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

