            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :increased_bone_mineral_density ],
        :osteosclerosis ;
    :has_definition "An osteosclerosis that is characterized by hyperostosis and sclerosis of the craniofacial bones associated with abnormal modeling of the metaphyses." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

