            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :hyperostosis ;
    :has_definition "A hyperostosis that has_material_basis_in a mutation in the LRP5 gene which results_in increased bone density and bony structures located_in palate." ;
    :has_exact_synonym "Worth's syndrome"@en,
        "autosomal dominant endosteal hyperostosis"@en,
        "autosomal dominant osteosclerosis"@en,
        "benign form of Worth hyperostosis corticalis generalisata with torus platinus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
