@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fibrogenesis_imperfecta_ossium rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that involves abnormality of collagen synthesis in lamellar bones, with manifestations limited to the skeleton. The initial symptom is frequently spontaneous fractures." ;
    :has_exact_synonym "Baker's disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

