        :osteochondrodysplasia ;
    :has_definition "An osteochondrodysplasia that has_material_basis_in mutation in the FGFR3 gene which affects ossification of cartilage and results_in short limb dwarfism." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

