    :has_definition "An osteochondrodysplasia that has_material_basis_in mutations in the COMP gene which results_in short limb dwarfism." ;
    :has_exact_synonym "SPONDYLOEPIPHYSEAL DYSPLASIA, PSEUDOACHONDROPLASTIC"@en,
