@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acromesomelic_dysplasia_grebe_type rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :acromesomelic_dysplasia,
        :autosomal_recessive_disease ;
    :has_definition "An acromesomelic dysplasia that has_material_basis_in mutation in CDMP-1 which results_in micromelia, absence of middle and proximal phalanges and some metacarpal and metatarsal bones." ;
    :has_exact_synonym "acromesomelic dysplasia-2A",
        "grebe chondrodysplasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:albright_s_hereditary_osteodystrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :short_stature ],
        :pseudohypoparathyroidism ;
    :has_definition "An pseudohypoparathyroidism that has_material_basis_in lack of responsiveness to parathyroid hormone which results in shortening and widening of long bones of the located in hand or located in foot along with short stature, obesity, and rounded face." ;
    :has_exact_synonym "Albright hereditary osteodystrophy"@en,
        "pseudohypoparathyroidism type 1a"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:achondrogenesis_type_ia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :vertebral_column ],
        :achondrogenesis,
        :autosomal_recessive_disease,
        :spinal_disease ;
    :has_definition "An achondrogenesis that results_in abnormal ossification of the located_in vertebral column or located_in spine." ;
    :has_exact_synonym "achondrogenesis Houston-Harris type"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:achondrogenesis_type_ib rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :achondrogenesis,
        :autosomal_recessive_disease ;
    :has_definition "An achondrogenesis that has_material_basis_in mutation in the SLC26A2 gene which results_in umbilical or inguinal hernia and a prominent rounded abdomen." ;
    :has_exact_synonym "achondrogenesis Fraccaro type"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:achondrogenesis_type_ii rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :vertebral_column ;
                            rdf:rest [ rdf:first :bony_pelvis ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :achondrogenesis,
        :autosomal_dominant_disease ;
    :has_definition "An achondrogenesis that has_material_basis_in mutations in the COL2A1 gene which results_in underdeveloped lungs, hydrops fetalis, a prominent forehead and abnormal ossification of the located_in vertebral column or located_in pelvis." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_spinocerebellar_ataxia_15 rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that has_material_basis_in homozygous mutation in the RUBCN gene on chromosome 3q29." ;
    :has_exact_synonym "SCAR15" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_spinocerebellar_ataxia_14 rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that is characterized by delayed psychomotor development, severe early-onset gait ataxia, eye movement abnormalities, cerebellar atrophy on brain imaging, and intellectual disability and that has_material_basis_in homozygous mutation in the SPTBN2 gene on chromosome 11q13." ;
    :has_exact_synonym "SCAR14" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_spinocerebellar_ataxia_7 rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that is characterized by onset of progressive gait difficulties, eye movement abnormalities, and dysarthria in the first or second decade of life and that has_material_basis_in compound heterozygous mutation in the TPP1 gene on chromosome 11p15." ;
    :has_exact_synonym "SCAR7" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_spinocerebellar_ataxia_12 rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that is characterized by onset of generalized seizures in infancy, delayed psychomotor development with mental retardation, and cerebellar ataxia and that has_material_basis_in homozygous mutation in the WWOX gene on chromosome 16q23." ;
    :has_exact_synonym "SCAR12" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_spinocerebellar_ataxia_2 rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that is characterized by juvenile onset of progressive cerebellar ataxia, axonal sensorimotor peripheral neuropathy, and increased serum alpha-fetoprotein, and has_material_basis_in homozygous or compound heterozygous mutation in the senataxin gene on chromosome 9q34." ;
    :has_exact_synonym "SCAR2" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_spinocerebellar_ataxia_13 rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that is characterized by delayed psychomotor development beginning in infancy and that has_material_basis_in homozygous mutation in the GRM1 gene on chromosome 6q24." ;
    :has_exact_synonym "SCAR13" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_spinocerebellar_ataxia_11 rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that has_material_basis_in homozygous mutation in the SYT14 gene on chromosome 1q32." ;
    :has_exact_synonym "SCAR11" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_spinocerebellar_ataxia_17 rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that has_material_basis_in homozygous mutation in the CWF19L1 gene on chromosome 10q24." ;
    :has_exact_synonym "SCAR17" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_spinocerebellar_ataxia_19 rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that is characterized by postnatal onset of severe progressive sensorineural hearing loss and progressive cerebellar ataxia and that has_material_basis_in homozygous mutation in the SLC9A1 gene on chromosome 1p36." ;
    :has_exact_synonym "Lichtenstein-Knorr syndrome",
        "SCAR19" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_spinocerebellar_ataxia_20 rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that is characterized by severely delayed psychomotor development with poor or absent speech, wide-based or absent gait, coarse facies, and cerebellar atrophy and that has_material_basis_in homozygous mutation in the SNX14 gene on chromosome 6q14." ;
    :has_exact_synonym "SCAR20" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:charcot_marie_tooth_disease_type_5 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :charcot_marie_tooth_disease ;
    :has_definition "A Charcot-Marie-Tooth disease that is characterized by pyramidal features including extensor plantar responses, mild increase in tone, and preserved or increased reflexes but no spastic gait." ;
    :has_exact_synonym "hereditary motor and sensory neuropathy with pyramidal features"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:charcot_marie_tooth_disease_type_6 rdfs:subClassOf :charcot_marie_tooth_disease ;
    :has_definition "A Charcot-Marie-Tooth disease that is characterized by early-onset optic atrophy resulting in progressive visual loss and peripheral axonal sensorimotor neuropathy with highly variable age at onset and severity." ;
    :has_exact_synonym "hereditary motor and sensory neuropathy type 6"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:charcot_marie_tooth_disease_type_7 rdfs:subClassOf :charcot_marie_tooth_disease ;
    :has_definition "A Charcot-Marie-Tooth disease that is characterized by optic atrophy followed by retinitis pigmentosa." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

