    :has_definition "A mucolipidosis that is characterized by short stature, skeletal abnormalities, cardiomegaly, and developmental delay, caused by a defect in proper lysosomal enzyme phosphorylation and localization, which results in accumulation of lysosomal substrates, and that has_material_basis_in homozygous or compound heterozygous mutation in the GNPTAB gene." ;
    :has_exact_synonym "inclusion-cell disease",
        "I-cell disease"@en,
        "mucolipidosis II"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

