            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :mucolipidosis ;
    :has_definition "A mucolipidosis that has_material_basis_in mutation in the gene encoding the alpha/beta-subunits precursor gene of GLcNAc-phosphotransferase." ;
    :has_exact_synonym "pseudo-Hurler polydystrophy",
        "mucolipidosis III"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

