    :has_definition "A spina bifida that is characterized by minor splits in the vertebrae where the outer part of some of the vertebrae is not completely closed." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neural_tube_defect rdfs:subClassOf :physical_disorder ;
    :has_definition "A physical disorder characterized by incomplete closure of the neural tube." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
