@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypophosphatemic_nephrolithiasis_osteoporosis_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :hypophosphatemic_nephrolithiasis_osteoporosis ;
    :has_definition "A hypophosphatemic nephrolithiasis/osteoporosis that has_material_basis_in heterozygous mutation in the SLC9A3R1 gene on chromosome 17q25.1." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nonsyndromic_congenital_nail_disorder_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
