    :has_exact_synonym "HYPONYCHIA CONGENITA"@en,
        "anonychia congenita"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nonsyndromic_congenital_nail_disorder_5 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :autosomal_dominant_disease,
        :nonsyndromic_congenital_nail_disorder ;
    :has_definition "A nonsyndromic congenital nail disorder that is characterized by a decreased growth rate, thick and hard nails, and a straight or concave proximal edge of detachment." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nonsyndromic_congenital_nail_disorder_6 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :nonsyndromic_congenital_nail_disorder ;
    :has_definition "A nonsyndromic congenital nail disorder that is characterized by partial absences of nails." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nonsyndromic_congenital_nail_disorder_7 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :nonsyndromic_congenital_nail_disorder ;
    :has_definition "A nonsyndromic congenital nail disorder that is characterized by nails with longi- tudinal streaks, thinning of the nail plate, poorly developed or absent lunulae, along with variously disturbed formation of the nail plate leading to increased vulnerability of the free nail margins." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

