    :has_exact_synonym "autosomal recessive limb-girdle muscular dystrophy type 2R"@en,
        "desminopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myofibrillar_myopathy_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :myofibrillar_myopathy ;
    :has_definition "A myofibrillar myopathy that has_material_basis_in heterozygous mutation in the alpha-B-crystallin gene on chromosome 11q23." ;
    :has_exact_synonym "alpha-b crystallinopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myofibrillar_myopathy_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :myofibrillar_myopathy ;
    :has_definition "A myofibrillar myopathy that has_material_basis_in heterozygous mutation in the MYOT gene on chromosome 5q31." ;
    :has_exact_synonym "LGMD 1A",
        "spheroid body myopathy",
        "autosomal dominant limb-girdle muscular dystrophy type 1A"@en,
        "myotilinopathy"@en .

