        :autosomal_dominant_disease,
        :myofibrillar_myopathy ;
    :has_definition "A myofibrillar myopathy that has_material_basis_in heterozygous mutation in the ZASP gene on chromosome 10." ;
    :has_exact_synonym "zaspopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

