        :autosomal_dominant_disease,
        :myofibrillar_myopathy ;
    :has_definition "A myofibrillar myopathy that has_material_basis_in heterozygous mutation in the FLNC gene on chromosome 7q32." ;
    :has_exact_synonym "filaminopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myofibrillar_myopathy_6 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :myofibrillar_myopathy ;
    :has_definition "A myofibrillar myopathy that has_material_basis_in heterozygous mutation in the BAG3 gene on chromosome 10q26." ;
    :has_related_synonym "BAG3-related myofibrillar myopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myofibrillar_myopathy_7 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :myofibrillar_myopathy ;
    :has_definition "A myofibrillar myopathy that has_material_basis_in homozygous mutation in the KY gene on chromosome 3q22." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myopathy_lactic_acidosis_and_sideroblastic_anemia rdfs:subClassOf :mitochondrial_myopathy ;
    :has_definition "A mitochondrial myopathy that is characterized by progressive exercise intolerance manifesting in childhood, onset of sideroblastic anaemia around adolescence, lactic acidaemia, and mitochondrial myopathy." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:compton_north_congenital_myopathy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :autosomal_recessive_disease,
        :congenital_myopathy,
        :physical_disorder ;
    :has_definition "A congenital myopathy that has_material_basis_in homozygous mutation in the CNTN1 gene on chromosome 12q12 and that is characterized antenatally, by fetal akinesia, intrauterine growth restriction and polyhydramnios, and, following birth, by severe neonatal hypotonia, severe generalized skeletal, bulbar and respiratory muscle weakness, multiple flexion contractures, and normal creatine kinase serum levels." ;
    :has_exact_synonym "congenital myopathy 12" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_4a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :autosomal_dominant_disease,
        :congenital_myopathy,
        :physical_disorder ;
    :has_definition "A congenital myopathy that is characterized by skeletal muscle weakness, particularly in the muscles of the shoulders, upper arms, hips, and thighs." ;
    :has_exact_synonym "congenital fiber-type disproportion",
        "CFTD"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

