    :has_definition "A connective tissue benign neoplasm that is characterized by the development of benign tumors in the skin, striated muscles, bones, and in exceptional cases, visceral organs." ;
    :has_exact_synonym "lipofibromatosis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:contractures_pterygia_and_spondylocarpotarsal_fusion_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :gene ],
        :monogenic_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by permanently bent fingers, short stature, rocker-bottom or club feet, joints that are bent in a fixed position, union or webbing of the skin between the fingers, and/or webbing of the neck, inside bend of the elbows, back of the knees and armpits." ;
    :has_exact_synonym "multiple pterygium syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

