        :mitochondrial_complex_iii_deficiency ;
    :has_definition "A mitochondrial complex III deficiency characterized by onset at birth of lactic acidosis, hypotonia, hypoglycemia, failure to thrive, encephalopathy, and delayed psychomotor development and that has_material_basis_in homozygous or compound heterozygous mutation in the nuclear-encoded BCS1L gene on chromosome 2q35." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_complex_iii_deficiency_nuclear_type_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :mitochondrial_complex_iii_deficiency ;
    :has_definition "A mitochondrial complex III deficiency that has_material_basis_in homozygous mutation in the UQCRB gene on chromosome 8q22." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_complex_iii_deficiency_nuclear_type_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :mitochondrial_complex_iii_deficiency ;
    :has_definition "A mitochondrial complex III deficiency that has_material_basis_in homozygous mutation in the UQCRQ gene on chromosome 5q31." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_complex_iii_deficiency_nuclear_type_5 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :mitochondrial_complex_iii_deficiency ;
    :has_definition "A mitochondrial complex III deficiency characterized by neonatal onset of severe metabolic acidosis associated with hyperammonemia and hypoglycemia and that has_material_basis_in homozygous mutation in the UQCRC2 gene on chromosome 16p12." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_complex_iii_deficiency_nuclear_type_6 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :mitochondrial_complex_iii_deficiency ;
    :has_definition "A mitochondrial complex III deficiency characterized by onset in early childhood of episodic acute lactic acidosis, ketoacidosis, and insulin-responsive hyperglycemia, usually associated with infection and that has_material_basis_in homozygous mutation in the CYC1 gene on chromosome 8q24." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_complex_iii_deficiency_nuclear_type_7 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :mitochondrial_complex_iii_deficiency ;
    :has_definition "A mitochondrial complex III deficiency that has_material_basis_in homozygous mutation in the UQCC2 gene on chromosome 6p21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_complex_iii_deficiency_nuclear_type_8 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :mitochondrial_complex_iii_deficiency ;
    :has_definition "A mitochondrial complex III deficiency characterized by childhood onset of progressive neurodegeneration that has_material_basis_in homozygous mutation in the LYRM7 gene on chromosome 5q23." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_complex_iii_deficiency_nuclear_type_9 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :mitochondrial_complex_iii_deficiency ;
    :has_definition "A mitochondrial complex III deficiency that has_material_basis_in homozygous mutation in the UQCC3 gene on chromosome 11q12." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_dna_depletion_syndrome_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :ptosis ],
        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by onset between the second and fifth decades of life of ptosis, progressive external ophthalmoplegia, gastrointestinal dysmotility, cachexia, diffuse leukoencephalopathy, peripheral neuropathy, and mitochondrial dysfunction, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the nuclear-encoded thymidine phosphorylase gene on chromosome 22q13." ;
    :has_exact_synonym "mitochondrial DNA depletion syndrome 1 (MNGIE type)"@en,
        "mitochondrial neurogastrointestinal encephalopathy syndrome, TYMP-related"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_dna_depletion_syndrome_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by childhood onset of muscle weakness associated with depletion of mtDNA in skeletal muscle, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the mitochondrial thymidine kinase gene on chromosome 16q21." ;
    :has_exact_synonym "TK2-related mitochondrial DNA depletion syndrome, myopathic form"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_dna_depletion_syndrome_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by onset in infancy of progressive liver failure and neurologic abnormalities, hypoglycemia, and increased lactate in body fluids, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the deoxyguanosine kinase gene on chromosome 2p13." ;
    :has_exact_synonym "deoxyguanosine kinase deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alpers_huttenlocher_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by a clinical triad of psychomotor retardation, intractable epilepsy, and liver failure in infants and young children, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the nuclear gene encoding mitochondrial DNA polymerase gamma on chromosome 15q26." ;
    :has_exact_match "MESH:D002549" ;
    :has_exact_synonym "Diffuse Cerebral Sclerosis of Schilder",
        "mitochondrial DNA depletion syndrome 4a",
        "Alper's syndrome"@en,
        "Alpers disease"@en,
        "Alpers progressive infantile poliodystrophy"@en,
        "Alpers syndrome"@en,
        "Alpers' disease or gray-matter degeneration"@en,
        "progressive sclerosing poliodystrophy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_dna_depletion_syndrome_4b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by chronic gastrointestinal dysmotility and pseudoobstruction, cachexia, progressive external ophthalmoplegia, axonal sensory ataxic neuropathy, and muscle weakness, and has_material_basis_in autosomal recessive inheritance of compound heterozygous mutation in the mitochondrial DNA polymerase gamma gene on chromosome 15q26." ;
    :has_exact_synonym "mitochondrial neurogastrointestinal encephalopathy syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_dna_depletion_syndrome_5 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by infantile onset of hypotonia, progressive neurologic deterioration, a hyperkinetic-dystonic movement disorder, external ophthalmoplegia, deafness, and variable renal tubular dysfunction, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the beta subunit of the succinate-CoA ligase gene on chromosome 13q14." ;
    :has_exact_synonym "succinate-CoA ligase deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_dna_depletion_syndrome_6 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by infantile onset of progressive liver failure, often leading to death in the first year of life, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the mitochondrial inner membrane protein MPV17 gene on chromosome 2p23." ;
    :has_exact_synonym "MPV17-related hepatocerebral mitochondrial DNA depletion syndrome"@en,
        "Navajo neurohepatopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_dna_depletion_syndrome_7 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by progressive ataxia, hypotonia, hyporeflexia, athetosis and sensory impairment and has_material_basis_in autosomal recessive homozygous or compound heterozygous mutation in the C10ORF2 gene, which encodes the twinkle and twinky proteins, on chromosome 10q24." ;
    :has_exact_synonym "OHAHA SYNDROME"@en,
        "infantile onset spinocerebellar ataxia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_dna_depletion_syndrome_8a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by neonatal hypotonia, lactic acidosis, and neurologic deterioration, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the ribonucleotide reductase regulatory TP53 inducible subunit M2B gene on chromosome 8q22." ;
    :has_exact_synonym "RRM2B-related mitochondrial DNA depletion syndrome, encephalomyopathic form with renal tubulopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_dna_depletion_syndrome_9 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by infantile onset of hypotonia, lactic acidosis, severe psychomotor retardation, progressive neurologic deterioration, and excretion of methylmalonic acid, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the alpha subunit of the succinate-CoA ligase gene on chromosome 2p11." ;
    :has_exact_synonym "fatal infantile lactic acidosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_dna_depletion_syndrome_11 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by onset in childhood or adulthood of progressive external ophthalmoplegia (PEO), muscle weakness and atrophy, exercise intolerance, and respiratory insufficiency due to muscle weakness, and has_material_basis_in autosomal recessive inheritance of homozygous mutation in the mitochondrial genome maintenance exonuclease 1 gene on chromosome 20p11." ;
    :has_exact_synonym "progressive external ophthalmoplegia-myopathy-emaciation syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_dna_depletion_syndrome_12a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by severe hypotonia due to mitochondrial dysfunction apparent at birth and has_material_basis_in autosomal dominant inheritance of heterozygous mutation in the solute carrier family 25 member 4 gene on chromosome 4q35." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_dna_depletion_syndrome_13 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by early infantile onset of encephalopathy, hypotonia, lactic acidosis, and severe global developmental delay, and has_material_basis_in autosomal recessive inheritance of homozygous mutation in the F-box and leucine-rich repeat protein 4 gene on chromosome 6q16." ;
    :has_exact_synonym "FBXL4 deficiency"@en,
        "FBXL4-related encephalomyopathic mitochondrial DNA depletion syndrome"@en,
        "mitochondrial DNA depletion syndrome 13, encephalomyopathic type"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sengers_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by congenital cataracts, hypertrophic cardiomyopathy, skeletal myopathy, exercise intolerance, and lactic acidosis, but normal mental development, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the acylglycerol kinase gene on chromosome 7q34." ;
    :has_exact_synonym "mitochondrial DNA depletion syndrome 10"@en,
        "mitochondrial DNA depletion syndrome 10 (cardiomyopathic type)"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_mitochondrial_dysfunctions_syndrome_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :multiple_mitochondrial_dysfunctions_syndrome ;
    :has_definition "A multiple mitochondrial dysfunctions syndrome that is characterized by weakness, respiratory failure, lack of neurologic development, lactic acidosis, and early death, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the NFU1 iron-sulfur cluster scaffold gene on chromosome 2p13." ;
    :has_exact_synonym "NFU1 deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_mitochondrial_dysfunctions_syndrome_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :multiple_mitochondrial_dysfunctions_syndrome ;
    :has_definition "A multiple mitochondrial dysfunctions syndrome that is characterized by increased serum glycine and lactate, developmental regression in infancy, an encephalopathic disease course with seizures, spasticity, loss of head control, and abnormal movement, and has_material_basis_in autosomal recessive inheritance of homozygous mutation in the bolA family member 3 gene on chromosome 2p13." ;
    :has_exact_synonym "BOLA3 deficiency"@en,
        "multiple mitochondrial dysfunctions syndrome 2 with hyperglycinemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_mitochondrial_dysfunctions_syndrome_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :multiple_mitochondrial_dysfunctions_syndrome ;
    :has_definition "A multiple mitochondrial dysfunctions syndrome that is characterized by loss of previously acquired developmental milestones in the first months or years of life, and has_material_basis_in autosomal recessive inheritance of homozygous mutation in the iron-sulfur cluster assembly factor IBA57 gene on chromosome 1q42." ;
    :has_exact_synonym "IBA57 deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_mitochondrial_dysfunctions_syndrome_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :multiple_mitochondrial_dysfunctions_syndrome ;
    :has_definition "A multiple mitochondrial dysfunctions syndrome that is characterized by normal development for the first months of life, followed by progressive loss of motor and social skills with hypotonia, spasticity, and nystagmus, resulting in death in early childhood, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the iron-sulfur cluster assembly 2 gene on chromosome 14q24." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_endocrine_neoplasia_type_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :multiple_endocrine_neoplasia ;
    :has_definition "A multiple endocrine neoplasia that is characterized by hyperparathyroidism and multiple endocrine tumors and that has_material_basis_in mutations in the CDKN1B gene on chromosome 12p13 resulting in a reduction in the amount of functional p27 tumor suppressor protein which allows cells to grow and divide unchecked." ;
    :has_exact_synonym "Multiple Endocrine Neoplasia, Type IV"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_congenital_anomalies_hypotonia_seizures_syndrome_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :autosomal_recessive_disease,
        :multiple_congenital_anomalies_hypotonia_seizures_syndrome ;
    :has_definition "A multiple congenital anomalies-hypotonia-seizures syndrome that is characterized by neonatal hypotonia, lack of psychomotor development, seizures, dysmorphic features, and variable congenital anomalies involving the cardiac, urinary, and gastrointestinal systems and has_material_basis_in homozygous mutation in the PIGN gene on chromosome 18q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_congenital_anomalies_hypotonia_seizures_syndrome_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :multiple_congenital_anomalies_hypotonia_seizures_syndrome,
        :x_linked_recessive_disease ;
    :has_definition "A multiple congenital anomalies-hypotonia-seizures syndrome that is characterized by X-linked recessive inheritance of dysmorphic features, neonatal hypotonia, myoclonic seizures and variable abnormalities involving the central nervous, cardiac, and urinary systems that has_material_basis_in mutation in the PIGA gene on chromosome Xp22." ;
    :has_exact_synonym "developmental and epileptic encephalopathy 20",
        "early infantile epileptic encephalopathy 20"@en,
        "glycosylphosphatidylinositol biosynthesis defect 4"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_congenital_anomalies_hypotonia_seizures_syndrome_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :multiple_congenital_anomalies_hypotonia_seizures_syndrome ;
    :has_definition "A multiple congenital anomalies-hypotonia-seizures syndrome that is characterized by neonatal hypotonia, lack of psychomotor development, seizures, dysmorphic features, and variable congenital anomalies involving the cardiac, urinary, and gastrointestinal systems and that has_material_basis_in homozygous or compound heterozygous mutation in the PIGT gene on chromosome 20q13." ;
    :has_exact_synonym "M syndrome",
        "light fixation seizure syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mosaic_variegated_aneuploidy_syndrome_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :mosaic_variegated_aneuploidy_syndrome ;
    :has_definition "A mosaic variegated aneuploidy syndrome that is characterized by slow growth before and after birth, shorter than average height, unusually small head size, and an increased risk of developing cancer in childhood, and that has_material_basis_in homozygous or compound heterozygous mutation in the BUB1B gene on chromosome 15q15." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mosaic_variegated_aneuploidy_syndrome_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :mosaic_variegated_aneuploidy_syndrome ;
    :has_definition "A mosaic variegated aneuploidy syndrome that is characterized by slowly before and after birth and typically normal head size and that has_material_basis_in homozygous or compound heterozygous mutation in the CEP57 gene on chromosome 11q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_fibrosis_of_the_extraocular_muscles rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :ocular_motility_disease,
        :physical_disorder ;
    :has_definition "An ocular motility disease that is characterized by the inability to move the eyes in certain directions, droopy eyelids and eyes that are fixed in an abnormal position." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

