            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :acute_lymphoblastic_leukemia ;
    :has_definition "An acute lymphocytic leukemia occuring during childhood." ;
    :has_exact_synonym "Childhood Acute Lymphoblastic Leukemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_t_cell_acute_lymphoblastic_leukemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
