        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :childhood_acute_lymphocytic_leukemia,
        :t_cell_acute_lymphoblastic_leukemia ;
    :has_definition "A childhood acute lymphoblastic leukemia that has_material_basis_in T-cells." ;
    :has_exact_synonym "T-cell childhood acute lymphocytic leukemia",
        "childhood precursor T-lymphoblastic lymphoma/leukemia" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

