            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :lymphocyte_of_b_lineage ],
        :childhood_acute_lymphocytic_leukemia,
        :lymphoma ;
    :has_definition "A childhood acute lymphoblastic leukemia that has_material_basis_in B-cells." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lymphoblastic_lymphoma rdfs:subClassOf :lymphoma ;
    :has_definition "A lymphoma that has_material_basis_in immature malignant lymphocytes (lymphoblasts) committed to the B-cell or T-cell lineage and located_in primarily lymph nodes or located_in extranodal sites." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

