            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :t_cell ],
        :lymphoblastic_lymphoma,
        :t_cell_non_hodgkin_lymphoma ;
    :has_definition "A lymphoblastic lymphoma that has_material_basis_in T-cells and that occurs during childhood." ;
    :has_exact_synonym "Childhood T lymphoblastic lymphoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

