            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :acute_monocytic_leukemia ;
    :has_definition "An acute monocytic leukemia occurring in adults." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adrenocorticotropic_hormone_deficiency rdfs:subClassOf :hypopituitarism ;
    :has_definition "A hypopituitarrium that is characterized by a decreased or absent production of adrenocorticotropic hormone by the pituitary gland." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

