@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:short_chain_acyl_coa_dehydrogenase_deficiency rdfs:subClassOf :lipid_metabolism_disorder ;
    :has_definition "A lipid metabolism disorder that is characterized by deficiency of the enzyme short chain acyl-CoA dehydrogenase that results in the inability to convert short chain fatty acids." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:very_long_chain_acyl_coa_dehydrogenase_deficiency rdfs:subClassOf :lipid_metabolism_disorder ;
    :has_definition "A lipid metabolism disorder that is characterized by deficiency of the enzyme very long chain acyl-CoA dehydrogenase that results in the inability to convert very long chain fatty acids." ;
    :has_exact_synonym "VLCAD deficiency" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_adrenal_hypoplasia_congenita rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :adrenal_cortical_hypofunction,
        :x_linked_recessive_disease ;
    :has_definition "An adrenal cortical hypofunction that is characterized by a reduction in adrenal gland function resulting from incomplete development of the adrenal cortex and has_material_basis_in the nuclear receptor NR0B1 (DAX1) gene." ;
    :has_exact_synonym "congenital adrenal hypoplasia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

