    :has_definition "A keratitis that has_material_basis_in herpes simplex type infection." ;
    :has_exact_synonym "dendritic keratitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cryptococcal_meningitis rdfs:subClassOf :fungal_meningitis ;
    :has_definition "A fungal meningitis that has_material_basis_in Crypococcus fungal infection." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

