    :has_definition "A retinitis that has_material_basis_in Cytomegalovirus." ;
    :has_exact_synonym "CMV retinitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

