            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :glomerulonephritis ;
    :has_definition "A glomerulonephritis that is characterized by inflammation of the kidneys resulting from systemic lupus erythematosus." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:otulipenia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :immune_system_disease ;
    :has_definition "An immune system disease that is characterized by neonatal onset of recurrent fever, erythematous rash with painful nodules, painful joints, and lipodystrophy and has_material_basis_in autosomal recessive inheritance of homozygous loss-of-function mutations in the OTULIN gene encoding a deubiquitinase with linear linkage specificity on chromosome 5p15." ;
    :has_exact_synonym "autoinflammation, panniculitis and dermatosis syndrome"@en,
        "otulin-related autoinflammatory syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

