    :has_definition "A myeloid neoplasm that is characterized by the formation of abnormal fusion genes that encode constitutively activated tyrosine kinases." ;
    :has_exact_synonym "Myeloid and Lymphoid Neoplasms with Eosinophilia and Rearrangement of PDGFRA, PDGFRB, or FGFR1, or with PCM1-JAK2"@en,
        "Myeloid and lymphoid neoplasms with eosinophilia and abnormalities of platelet-derived growth factor receptor alpha (PDGFRA), platelet-derived growth factor receptor beta (PDGFRB), and fibroblast growth factor receptor-1 (FGFR1) are a group of hematologic neoplasms"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myeloid_and_lymphoid_neoplasms_associated_with_pdgfra_rearrangement rdfs:subClassOf :myeloid_and_lymphoid_neoplasms_with_eosinophilia_and_abnormalities_of_pdgfra_pdgfrb_and_fgfr1 ;
    :has_definition "A myeloid and lymphoid neoplasms with eosinophilia and abnormalities of PDGFRA, PDGFRB, and FGFR1 that is characterized by the rearrangement of the PDGFRA gene, most often resulting in the formation of FIP1L1-PDGFRA fusion transcripts." ;
    :has_exact_synonym "Myeloid and Lymphoid Neoplasms with PDGFRA Rearrangement"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myeloid_and_lymphoid_neoplasms_associated_with_pdgfrb_rearrangement rdfs:subClassOf :myeloid_and_lymphoid_neoplasms_with_eosinophilia_and_abnormalities_of_pdgfra_pdgfrb_and_fgfr1 ;
    :has_definition "A myeloid and lymphoid neoplasms with eosinophilia and abnormalities of PDGFRA, PDGFRB, and FGFR1 that is characterized by the rearrangement of the PDGFRB gene, most often resulting in the formation of ETV6-PDGFRB fusion transcripts." ;
    :has_exact_synonym "Myeloid and Lymphoid Neoplasms with PDGFRB Rearrangement"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myeloid_and_lymphoid_neoplasms_associated_with_fgfr1_abnormalities rdfs:subClassOf :myeloid_and_lymphoid_neoplasms_with_eosinophilia_and_abnormalities_of_pdgfra_pdgfrb_and_fgfr1 ;
    :has_definition "A myeloid and lymphoid neoplasms with eosinophilia and abnormalities of PDGFRA, PDGFRB, and FGFR1 that is characterized by the rearrangement of the FGFR1 gene, resulting in translocations with an 8p11 breakpoint." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tricuspid_atresia rdfs:subClassOf :tricuspid_valve_disease ;
    :has_definition "A tricuspid valve disease characterized by a missing or abnormally developed tricuspid heart value at birth." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:normophosphatemic_familial_tumoral_calcinosis rdfs:subClassOf :calcinosis ;
    :has_definition "A calcinosis that is characterized by massive periarticular, and seldom visceral, deposition of calcified tumors." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

