    :has_definition "A gastrointestinal system disease that is characterized by abnormal development of the esophagus and trachea where the upper esophagus does not connect (atresia) to the lower esophagus and stomach and may also include tracheoesophageal fistula where the esophagus and the trachea are abnormally connected which allows fluids from the esophagus to get into the airways and interfere with breathing." ;
    :has_exact_synonym "esophageal atresia and/or tracheoesophageal fistula"@en,
        "tracheoesophageal fistula with or without esohageal atresia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thiopurine_s_methyltransferase_deficiency rdfs:subClassOf :inherited_metabolic_disorder ;
    :has_definition "An inherited metabolic disease that is characterized by significantly reduced activity of an enzyme that helps the body process drugs called thiopurines." ;
    :has_exact_synonym "TPMT deficiency"@en,
        "poor metabolism of thiopurines-1"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bladder_exstrophy_epispadias_cloacal_exstrophy_complex rdfs:subClassOf :physical_disorder ;
    :has_definition "A physical disorder that is characterized as a spectrum of anomalies involving the urinary tract, genital tract, musculoskeletal system and sometimes the intestinal tract." ;
    :has_exact_synonym "exstrophy-epispadias complex"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bladder_exstrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :urinary_bladder ],
        :bladder_disease,
        :bladder_exstrophy_epispadias_cloacal_exstrophy_complex ;
    :has_definition "A bladder exstrophy-epispadias-cloacal exstrophy complex that is characterized by an evaginated bladder plate, epispadias and an anterior defect of the pelvis, pelvic floor and abdominal wall. The rear portion of the bladder wall (posterior vesical wall) turns outward (exstrophy) through an opening in the abdominal wall and urine is excreted through this opening." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cloacal_exstrophy rdfs:subClassOf :bladder_exstrophy_epispadias_cloacal_exstrophy_complex ;
    :has_definition "A bladder exstrophy-epispadias-cloacal exstrophy complex that is characterized by a defect in the urethra, bladder and bowel." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

