    :has_definition "A hepatic vascular disease that is characterized by obstruction of some of the small veins of the liver." ;
    :has_exact_match "MESH:D006504" ;
    :has_exact_synonym "veno-occlusive disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucositis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :gastrointestinal_system_disease ;
    :has_definition "A gastrointestinal system disease that is characterized by painful inflammation and ulceration of the mucous membranes lining the digestive tract." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:haemophilus_meningitis rdfs:subClassOf :bacterial_meningitis ;
    :has_definition "A bacterial meningitis that has_material_basis_in Haemophilus influenzae infection." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:zika_virus_congenital_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :physical_disorder,
        :syndrome ;
    :has_definition "A syndrome that is characterized in neonates by microcephaly, craniofacial disproportion, spasticity, seizures, irritability and brainstem dysfunction including feeding difficulties, ocular abnormalities and findings on neuroimaging such as calcifications, cortical disorders and ventriculomegaly and has_material_basis_in the acquisition of Zika virus infection in utero." ;
    :has_exact_synonym "ZIKV congenital infection"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pharc_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by polyneuropathy, hearing loss, cerebellar ataxia, retinitis pigmentosa and early-onset cataract." ;
    :has_exact_synonym "polyneyropathy, hearing loss, ataxia, retinitis pigmentosa, and cataract"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

