    :has_definition "A fibrolamellar carcinoma that is characterized by the presence of both pure fibrolamellar hepatocellular carcinoma and and conventional hepatocellular carcinoma components." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

