    :has_definition "A colon carcinoma that is characterized by a solid growth pattern." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mixed_mucinous_and_nonmucinous_bronchioloalveolar_adenocarcinoma rdfs:subClassOf :bronchiolo_alveolar_adenocarcinoma ;
    :has_definition "A bronchiolo-alveolar adenocarcinoma that is characterized by a mixed array of different patterns (acinar, papillary, bronchioloalveolar, solid with mucin)." ;
    :has_exact_synonym "indeterminate bronchioloalveolar carcinoma"@en,
        "mixed mucinous and non-mucinous bronchioloalveolar adenocarcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucinous_bronchioloalveolar_adenocarcinoma rdfs:subClassOf :bronchiolo_alveolar_adenocarcinoma ;
    :has_definition "A bronchiolo-alveolar adenocarcinoma that is characterized by a tumour cells containing abundant mucin in their cytoplasm and composed of tall columnar cells growing along alveolar walls without stromal invasion." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nonmucinous_bronchioloalveolar_adenocarcinoma rdfs:subClassOf :bronchiolo_alveolar_adenocarcinoma ;
    :has_definition "A bronchiolo-alveolar adenocarcinoma that is characterized by cells with cuboidal or columnar morphology with eosinophilic or clear cytoplasm and shows Clara cell or type 2 pneumocyte differentiation." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_neutrophilic_leukemia rdfs:subClassOf :chronic_leukemia ;
    :has_definition "A chronic leukemia characterized by neutrophilic leukocytosis with no detectable Philadelphia chromosome or BCR/ABL fusion gene." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_myelomonocytic_leukemia rdfs:subClassOf :chronic_leukemia ;
    :has_definition "A chronic leukemia characterized by monocytosis, increased monocytes in the bone marrow, variable degrees of dysplasia, but an absence of immature granulocytes in the blood." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_hemangioma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :vascular_system ],
        :sarcoma,
        :vascular_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from ;
                                    owl:someValuesFrom :hemangioblast ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A cell type cancer of vascular origin that is characterized by the proliferation of endothelial cells in and about the vascular lumen." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_epithelioid_hemangioendothelioma rdfs:subClassOf :malignant_hemangioma ;
    :has_definition "A malignant hemangioma characterized by the presence of epithelioid endothelial cells. The neoplastic cells are arranged in cords and nests, which are embedded in a myxoid to hyalinized stroma." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pten_hamartoma_tumor_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome characterized as a spectrum of disorders (Cowden syndrome, Bannayan-Riley-Ruvalcaba syndrome, PTEN-related Proteus syndrome, and Proteus-like syndrome) caused by germline mutations of the PTEN gene." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:relapsed_refractory_diffuse_large_b_cell_lymphoma rdfs:subClassOf :diffuse_large_b_cell_lymphoma ;
    :has_definition "A diffuse large B-cell lymphoma characterized by less than 50 percent decrease in lesion size with induction therapy or the appearance of new lesions or the appearance of new lesions after attainment of complete remission." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:superior_semicircular_canal_dehiscence rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bone_conduction_hyperacusis ],
        :inner_ear_disease ;
    :has_definition "An inner ear disease characterized by dehiscence in the bone overlying the superior semicircular canal experience with symptoms of pressure or sound-induced vertigo, bone conduction hyperacusis, and pulsatile tinnitus." ;
    :has_exact_synonym "canal dehiscence syndrome"@en,
        "superior canal dehiscence"@en,
        "superior canal syndrome"@en,
        "superior semicircular canal dehiscence syndrome"@en,
        "third mobile window syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:carey_fineman_ziter_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :ptosis ],
        :syndrome ;
    :has_definition "A syndrome characterized by hypotonia, Moebius sequence (bilateral congenital facial palsy with impairment of ocular abduction), Pierre Robin complex (micrognathia, glossoptosis, and high-arched or cleft palate), delayed motor milestones, and failure to thrive." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marinesco_sjogren_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :progressive_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by congenital cataracts, cerebellar ataxia, progressive muscle weakness due to myopathy, and delayed psychomotor development." ;
    :has_exact_synonym "Garland-Moorhouse syndrome"@en,
        "Marinesco-Garland syndrome"@en,
        "Oligophrenic cerebellolenticular degeneration"@en,
        "hereditary oligophrenic cerebello-lental degeneration"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mandibulofacial_dysostosis_guion_almeida_type rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by progressive microcephaly, micrognathia, microtia, dysplastic ears, preauricular skin tags, speech delay, significant developmental delay, midface and malar hypoplasia." ;
    :has_exact_synonym "MFDM syndrome"@en,
        "mandibulofacial dysostosis with microcephaly"@en,
        "mandibulofacial dysostosis-microcephaly syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_muscular_dystrophy_with_cataracts_and_intellectual_disability rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :progressive_weakness ],
        :autosomal_recessive_disease,
        :congenital_muscular_dystrophy ;
    :has_definition "A congenital muscular dystrophy characterized by onset of progressive muscle weakness in early childhood with autosomal recessive inheritance that has_material_basis_in homozygous or compound heterozygous mutation in the INPP5K gene (607875) on chromosome 17p13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:infantile_histiocytoid_cardiomyopathy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :gene ],
        :intrinsic_cardiomyopathy,
        :monogenic_disease ;
    :has_definition "An intrinsic cardiomyopathy characterized by the presence of characteristic pale granular foamy histiocyte-like cells within the myocardium and has_material_basis_in a mutation in the gene encoding mitochondrial cytochrome b." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:colorectal_carcinoma rdfs:subClassOf [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from ;
                                    owl:someValuesFrom :epithelial_cell ] ;
                            rdf:rest :nil ] ] ],
        :carcinoma,
        :colorectal_cancer ;
    :has_definition "A colorectal cancer that arises from the colon or rectum and invades through the muscularis mucosa into the submucosa." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bilateral_renal_aplasia rdfs:subClassOf :renal_agenesis ;
    owl:disjointWith :potter_s_syndrome ;
    :has_definition "A renal agenesis that is characterized by the absence of both kidneys at birth." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:peters_plus_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that is characterized by anterior chamber eye anomalies, short limbs with broad distal extremities, characteristic facial features, cleft lip/palate, and variable developmental delay/intellectual disability." ;
    :has_exact_synonym "Krause-Kivlin syndrome"@en,
        "Peters anomaly-short limb dwarfism syndrome"@en,
        "Peters-plus syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adenoid_cystic_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :pharyngeal_tonsil ],
        :carcinoma,
        :tonsil_cancer ;
    :has_definition "An adenocarcinoma that is characterized by bands or cylinders of hyalinized or mucinous stroma separating or surrounded by nests or cords of small epithelial cells." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_hypoplasia rdfs:subClassOf :kidney_disease ;
    :has_definition "A kidney disease that is characterized by abnormally small kidneys with normal morphology and reduced number of nephrons." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cakut rdfs:subClassOf :urinary_system_disease ;
    :has_definition "A urinary system disease characterized by structural malformations in the kidney and/or urinary tract containing vesicoureteral reflux." ;
    :has_exact_synonym "Congenital anomalies of the kidney and urinary tract"@en,
        "Renal or urinary tract malformation"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cakut1 rdfs:subClassOf :cakut ;
    :has_definition "A CAKUT that has_material_basis_in heterozygous mutation in the DSTYK gene on chromosome 1q32." ;
    :has_exact_synonym "Congenital anomalies of the kidney and urinary tract 1"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cakut2 rdfs:subClassOf :cakut ;
    :has_definition "A CAKUT that has_material_basis_in heterozygous mutation in the TBX18 gene on chromosome 6q14." ;
    :has_exact_synonym "Congenital anomalies of the kidney and urinary tract 2"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sideroblastic_anemia_with_b_cell_immunodeficiency_periodic_fevers_and_developmental_delay rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :sideroblastic_anemia ;
    :has_definition "A sideroblastic anemia characterized by onset of severe sideroblastic anemia in the neonatal period or infancy, has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the TRNT1 gene on chromosome 3p26." ;
    :has_exact_synonym "SIFD"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_mediastinal_b_cell_lymphoma rdfs:subClassOf :diffuse_large_b_cell_lymphoma ;
    :has_definition "A diffuse large B-cell lymphoma that is is characterized by a diffuse proliferation of medium to large B-cells associated with sclerosis." ;
    :has_exact_synonym "Large cell lymphoma of the mediastinum"@en,
        "Mediastinal diffuse large-cell lymphoma with sclerosis"@en,
        "Primary mediastinal clear cell lymphoma of B-cell type"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nodal_marginal_zone_lymphoma rdfs:subClassOf :marginal_zone_lymphoma ;
    :has_definition "A marginal zone B-cell lymphoma which morphologically resembles lymph nodes involved by marginal zone lymphomas of extranodal or splenic types, but without evidence of extranodal or splenic disease." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polycystic_kidney_disease_4 rdfs:subClassOf :autosomal_recessive_polycystic_kidney_disease ;
    :has_definition "A autosomal recessive polycystic kidney disease that has_material_basis_in mutation in the PKD4 gene." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:punctate_palmoplantar_keratoderma_type_ii rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :punctate_palmoplantar_keratoderma ;
    :has_definition "A punctate palmoplantar keratoderma that is characterized by multiple, asymptomatic, 1 to 2 mm-long, firm, hyperkeratotic projections on the palms, soles and digits." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:punctate_palmoplantar_keratoderma_type_i rdfs:subClassOf :punctate_palmoplantar_keratoderma ;
    :has_definition "A punctate palmoplantar keratoderma that is characterized by multiple hyperkeratotic centrally indented papules that develop in early adolescence or later and are irregularly distributed on the palms and soles." ;
    :has_exact_synonym "punctate palmoplantar keratoderma type 1A",
        "punctate palmoplantar keratoderma type 1B" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_8 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :developmental_and_epileptic_encephalopathy,
        :x_linked_recessive_disease ;
    :has_definition "A developmental and epileptic encephalopathy characterized by seizures with onset before 2 years of age, severe developmental delay, and in some patients hyperekplexia that has_material_basis_in X-linked recessive inheritance of a mutation in the ARHGEF9 gene on chromosome Xq22.1." ;
    :has_exact_synonym "DEE8",
        "EIEE8",
        "early infantile epileptic encephalopathy 8" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:duodenal_atresia rdfs:subClassOf :intestinal_atresia ;
    :has_definition "An intestinal atresia that is characterized by congenital absence or complete closure of a portion of the lumen of the duodenum." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lysosomal_acid_lipase_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :lipid_storage_disease ;
    :has_broader_match "ICD10CM:E75.5" ;
    :has_definition "A lipid storage disease characterized by dyslipidemia and accumulation of cholesteryl esters and triglycerides within various organs that has_material_basis_in homozygous or compound heterozygous mutation in the LIPA gene on chromosome 10q23.31." ;
    :has_exact_match "GARD:12097",
        "OMIM:PS278000",
        "ORDO:275761",
        "UMLS_CUI:C5574740" ;
    :has_exact_synonym "LAL deficiency",
        "LAL-D" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_spontaneous_pneumothorax rdfs:subClassOf :pneumothorax ;
    :has_definition "A pneumothorax that is characterized by an abnormal accumulation of air in the space between the lungs and the chest cavity that can result in the partial or complete collapse of a lung." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dystransthyretinemic_hyperthyroxinemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :hyperthyroxinemia ;
    :has_definition "A hyperthyroxinemia that is characterized by an increased affinity for thyroxine (T4) by transthyretin in clinically euthyroid individuals and that has_material_basis_in heterozygous mutation in the TTR gene on chromosome 18q12." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pseudohypoparathyroidism_type_ib rdfs:subClassOf :pseudohypoparathyroidism ;
    :has_definition "A pseudohypoparathyroidism characterized by isolated renal parathyroid hormone (PTH) resistance resulting in hypocalcemia, hyperphosphatemia and elevated PTH levels that has_material_basis_in mutations that alter the methylation pattern of GNAS on 20q13.32." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epidermolytic_palmoplantar_keratoderma rdfs:subClassOf :palmoplantar_keratosis ;
    :has_definition "A palmoplantar keratosis that is characterized by marked hyperkeratosis on the surface of palms and soles." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_dystrophic_epidermolysis_bullosa rdfs:subClassOf :epidermolysis_bullosa_dystrophica ;
    :has_definition "An epidermolysis bullosa dystrophica that is characterized by recurrent blistering at the level of the lamina densa secondary to minor trauma, limited to the nails, hands, feet, knees, and elbows, and has_material_basis_in autosomal dominant inheritance of mutation in the COL7A1 gene, which encodes a protein that assists assembly of type VII collagen." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amyotrophic_lateral_sclerosis_type_23 rdfs:subClassOf :amyotrophic_lateral_sclerosis ;
    :has_definition "An amyotrophic lateral sclerosis that has_material_basis_in heterozygous mutation in the ANXA11 gene on chromosome 10q22." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_intellectual_developmental_disorder_56 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_intellectual_developmental_disorder ;
    :has_definition "An autosomal dominant intellectual developmental disorder that is characterized by global developmental delay, intellectual disability and in most cases hypotonia, delayed walking, poor fine motor skills, and poor or absent speech that has_material_basis_in heterozygous mutation in the CLTC gene on chromosome 17q23." ;
    :has_exact_synonym "autosomal dominant intellectual developmental disorder-56",
        "autosomal dominant mental retardation 56" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_intellectual_developmental_disorder_55 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_intellectual_developmental_disorder ;
    :has_definition "An autosomal dominant intellectual developmental disorder that is characterized by onset of myoclonic seizures in the first years of life, global developmental delay, intellectual disability, speech delay and ataxic gait that has_material_basis_in heterozygous mutation in the NUS1 gene on chromosome 6q22." ;
    :has_exact_synonym "autosomal dominant intellectual developmental disorder-55 with seizures",
        "autosomal dominant mental retardation 55" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_intellectual_developmental_disorder_53 rdfs:subClassOf :autosomal_dominant_intellectual_developmental_disorder ;
    :has_definition "An autosomal dominant intellectual developmental disorder that has_material_basis_in heterozygous mutation in the CAMK2A gene on chromosome 5q32." ;
    :has_exact_synonym "autosomal dominant mental retardation 53" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_intellectual_developmental_disorder_54 rdfs:subClassOf :autosomal_dominant_intellectual_developmental_disorder ;
    :has_definition "An autosomal dominant intellectual developmental disorder that has_material_basis_in heterozygous mutation in the CAMK2B gene on chromosome 7p13." ;
    :has_exact_synonym "autosomal dominant mental retardation 54" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_intellectual_developmental_disorder_52 rdfs:subClassOf :autosomal_dominant_intellectual_developmental_disorder ;
    :has_definition "An autosomal dominant intellectual developmental disorder that has_material_basis_in heterozygous mutation in the ASH1L gene on chromosome 1q22." ;
    :has_exact_synonym "autosomal dominant mental retardation 52" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_intellectual_developmental_disorder_51 rdfs:subClassOf :autosomal_dominant_intellectual_developmental_disorder ;
    :has_definition "An autosomal dominant intellectual developmental disorder that has_material_basis_in heterozygous mutation in the KMT5B gene on chromosome 11q13." ;
    :has_exact_synonym "autosomal dominant mental retardation 51" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_intellectual_developmental_disorder_50 rdfs:subClassOf :autosomal_dominant_intellectual_developmental_disorder ;
    :has_definition "An autosomal dominant intellectual developmental disorder that has_material_basis_in heterozygous mutation in the NAA15 gene on chromosome 4q31." ;
    :has_exact_synonym "autosomal dominant intellectual developmental disorder-50 with behavioral abnormalities",
        "autosomal dominant mental retardation 50" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:clark_baraitser_syndrome rdfs:subClassOf :autosomal_dominant_intellectual_developmental_disorder ;
    :has_definition "An autosomal dominant intellectual developmental disorder that has_material_basis_in heterozygous mutation in the TRIP12 gene on chromosome 2q36." ;
    :has_exact_synonym "Baraitser syndrome",
        "CLABARS",
        "autosomal dominant intellectual disability 49",
        "autosomal dominant mental retardation 49" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_intellectual_developmental_disorder_48 rdfs:subClassOf :autosomal_dominant_intellectual_developmental_disorder ;
    :has_definition "An autosomal dominant intellectual developmental disorder that has_material_basis_in heterozygous mutation in the RAC1 gene on chromosome 7p22." ;
    :has_exact_synonym "autosomal dominant mental retardation 48" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_intellectual_developmental_disorder_45 rdfs:subClassOf :autosomal_dominant_intellectual_developmental_disorder ;
    :has_definition "An autosomal dominant intellectual developmental disorder that has_material_basis_in heterozygous mutation in the CIC gene on chromosome 19q13." ;
    :has_exact_synonym "autosomal dominant mental retardation 45" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_intellectual_developmental_disorder_46 rdfs:subClassOf :autosomal_dominant_intellectual_developmental_disorder ;
    :has_definition "An autosomal dominant intellectual developmental disorder that has_material_basis_in heterozygous mutation in the KCNQ5 gene on chromosome 6q14." ;
    :has_exact_synonym "autosomal dominant mental retardation 46" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_intellectual_developmental_disorder_47 rdfs:subClassOf :autosomal_dominant_intellectual_developmental_disorder ;
    :has_definition "An autosomal dominant intellectual developmental disorder that has_material_basis_in heterozygous mutation in the STAG1 gene on chromosome 3q22." ;
    :has_exact_synonym "autosomal dominant mental retardation 47" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_61 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that has_material_basis_in homozygous mutation in the RUN and SH3 domain containing 2 gene (RUSC2) on chromosome 9p13." ;
