@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_erythrocytosis_5 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :primary_polycythemia ;
    :has_definition "A primary polycythemia characterized by autosomal dominant inheritance that has_material_basis_in heterozygous mutation in the EPO gene on chromosome 7q21." ;
    :has_exact_synonym "ECYT5"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_59 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by severe global developmental delay and onset of seizures in the first months of life that has_material_basis_in heterozygous mutation in the GABBR2 gene on chromosome 9q22." ;
    :has_exact_synonym "DEE59",
        "early infantile epileptic encephalopathy 59" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retinitis_pigmentosa_81 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :retinitis_pigmentosa ;
    :has_definition "A retinitis pigmentosa that has_material_basis_in homozygous mutation in the IFT43 gene on chromosome 14q24." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:short_rib_thoracic_dysplasia_18_with_polydactyly rdfs:subClassOf [ a owl:Restriction ;
