    :has_definition "An asphyxiating thoracic dystrophy that has_material_basis_in homozygous mutation in the IFT43 gene on chromosome 14q24." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:charcot_marie_tooth_disease_dominant_intermediate_g rdfs:subClassOf [ a owl:Restriction ;
