@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:short_rib_thoracic_dysplasia_19_with_or_without_polydactyly rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :asphyxiating_thoracic_dystrophy,
        :autosomal_recessive_disease ;
    :has_definition "An asphyxiating thoracic dystrophy that has_material_basis_in compound heterozygous mutation in the IFT81 gene on chromosome 12q24." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypomyelinating_leukodystrophy_14 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :hypomyelinating_leukodystrophy ;
    :has_definition "A hypomyelinating leukodystrophy that is characterized by hypotonia, almost complete lack of motor or cognitive skills, and absent language development and that has_material_basis_in homozygous mutation in the UFM1 gene on chromosome 13q13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:coffin_siris_syndrome_6 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :coffin_siris_syndrome ;
    :has_definition """A Coffin-Siris syndrome that is characterized by short stature, sparse hair, mild to severe intellectual disability, coarse facial features, and variable behavioral anomalies and that 
has_material_basis_in heterozygous mutation in the ARID2 gene on chromosome 12q12.""" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:complete_generalized_lipodystrophy rdfs:subClassOf :lipodystrophy ;
    :has_definition "A lipodystrophy that is characterized by complete loss of adipose tissue." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:partial_lipodystrophy rdfs:subClassOf :lipodystrophy ;
    :has_definition "A lipodystrophy that is characterized by partial loss of adipose tissue." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acquired_generalized_lipodystrophy rdfs:subClassOf :complete_generalized_lipodystrophy ;
    :has_definition "A complete generalized lipodystrophy that is characterized by generalized disappearance of fat occurring during childhood and adolescence where normal body fat is present at birth." ;
    :has_exact_synonym "Lawrence syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atypical_hemolytic_uremic_syndrome rdfs:subClassOf :complement_deficiency ;
    :has_definition "A complement deficiency that is characterized by mechanical hemolytic anemia, thrombocytopenia, and renal dysfunction." ;
    :has_exact_match "MESH:D065766" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mixed_sleep_apnea rdfs:subClassOf :sleep_apnea ;
    :has_definition "A sleep apnea that is characterized by a combination of central and obstructive sleep apnea." ;
    :has_exact_synonym "complex sleep apnea"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucinous_lung_adenocarcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :epithelial_cell ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_origin ;
                                            owl:someValuesFrom :mucous_gland ] ;
                                    rdf:rest :nil ] ] ] ],
        :lung_adenocarcinoma,
        :mucinous_adenocarcinoma ;
    :has_definition "A lung adenocarcinoma with tumor cells floating in pools of mucin that distend alveolar spaces." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lung_mucinous_cystadenocarcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :glandular_epithelial_cell ],
        :lung_adenocarcinoma ;
    :has_definition "A lung adenocarcinoma that is a very rare malignant mucus-producing neoplasm arising from the uncontrolled growth of transformed epithelial cells originating in lung tissue." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:signet_ring_lung_adenocarcinoma rdfs:subClassOf :lung_adenocarcinoma ;
    :has_definition "A lung adenocarcinoma containing a signet cell ring component characterized by abundant intracellular mucin accumulation and a displaced crescentic nucleus." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:solid_adenocarcinoma_with_mucin_production rdfs:subClassOf :lung_adenocarcinoma ;
    :has_definition "A lung adenocarcinoma that lacks acini, tubules, and papillae, and contains many mucin-containing cells." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myofibrillar_myopathy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :progressive_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :myopathy ;
    :has_definition "A myopathy that is characterized by slowly progressive muscle weakness that can involve both proximal muscles and distal muscles." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myofibrillar_myopathy_8 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :progressive_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :autosomal_recessive_disease,
        :myofibrillar_myopathy ;
    :has_definition "A myofibrillar myopathy that is characterized by childhood onset of slowly progressive proximal muscle weakness and atrophy resulting in increased falls, gait problems, and difficulty running or climbing stairs, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the PYROXD1 gene on chromosome 12p12." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fatal_infantile_hypertonic_myofibrillar_myopathy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :myofibrillar_myopathy ;
    :has_definition "A myofibrillar myopathy that has_material_basis_in homozygous mutation in the CRYAB gene on chromosome 11q23." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_mental_retardation_with_cerebellar_hypoplasia_and_distinctive_facial_appearance rdfs:subClassOf :syndromic_x_linked_intellectual_disability ;
    :has_definition "A syndromic X-linked intellectual disability characterized by neonatal hypotonia with motor delay but no obvious ataxia, marked strabismus, early-onset complex partial seizures, and moderate to severe mental retardation and has_material_basis_in mutation in the oligophrenin-1 gene." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neurodevelopmental_disorder_with_midbrain_and_hindbrain_malformations rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :neurodevelopmental_delay ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndromic_intellectual_disability ;
    :has_definition "A syndromic intellectual disability characterized by mild microcephaly, midbrain-hindbrain malformations, decreased reflexes, impaired fine motor movements, and variable dysmorphic features that has_material_basis_in homozygous mutation in the ARHGEF2 gene on chromosome 1q22." ;
    :has_exact_synonym "NEDMHM"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cleft_palate_lateral_synechia_syndrome rdfs:subClassOf :physical_disorder ;
    :has_definition "A physical disorder that is characterized by fusion of maxilla and mandible." ;
    :has_exact_synonym "CPLS syndrome"@en,
        "syngnathia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cone_rod_dystrophy_14 rdfs:subClassOf :cone_rod_dystrophy ;
    :has_definition "A cone-rod dystrophy that is characterized by deterioration of the cone in childhood or early adult life and progressive deterioration of the rod photoreceptor cells in later life that has_material_basis_in mutation in the GUCA1A gene on chromosome 6p21.1." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:megalencephalic_leukoencephalopathy_with_subcortical_cysts rdfs:subClassOf :leukodystrophy ;
    :has_definition "A leukodystorphy characterized by infantile-onset macrocephaly, often with mild neurologic signs at presentation (such as mild motor delay), which worse with time, leading to poor ambulation, falls, ataxia, spasticity, increasing seizures and cognitive decline." ;
    :has_exact_synonym "megalencephalic leukodystrophy megalencephaly-cystic leukodystorphy syndrome"@en,
        "vacuolating megalencephalic leukoencephalopathy with subcortical cysts"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:megalencephalic_leukoencephalopathy_with_subcortical_cysts_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :megalencephalic_leukoencephalopathy_with_subcortical_cysts ;
    :has_definition "A megalencephalic leukoencephalopathy with subcortical cysts characterized by early-onset macrocephaly and delayed-onset neurologic deterioration, including cerebellar ataxia, spasticity, epilepsy, and mild cognitive decline, that has_material_basis_in homozygous or compound heterozygous mutation in the MLC1 gene on chromosome 22q13." ;
    :has_exact_synonym "Van Der Knaap disease"@en,
        "leukoencephalopathy with swelling and cysts"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:megalencephalic_leukoencephalopathy_with_subcortical_cysts_2b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :megalencephalic_leukoencephalopathy_with_subcortical_cysts ;
    :has_definition "A megalencephalic leukoencephalopathy with subcortical cysts characterized by infantile-onset macrocephaly and mildly delayed motor development associated with white matter abnormalities that improve with age, and sometimes mental retardation that has_material_basis_in heterozygous mutation in the HEPACAM gene on chromosome 11q24." ;
    :has_exact_synonym "megalencephalic leukoencephalopathy with subcortical cysts 2B, remitting, with or without mental retardation" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:megalencephalic_leukoencephalopathy_with_subcortical_cysts_2a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :megalencephalic_leukoencephalopathy_with_subcortical_cysts ;
    :has_definition "A megalencephalic leukoencephalopathy with subcortical cysts characterized by infantile-onset macrocephaly and later onset of motor deterioration, with ataxia and spasticity, seizures, cognitive decline of variable severity, white matter abnormalities, including swelling of the cerebral white matter and subcortical cysts that has_material_basis_in homozygous or compound heterozygous mutation in the HEPACAM gene on chromosome 11q24." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_immunodeficiency_with_magnesium_defect_epstein_barr_virus_infection_and_neoplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :combined_t_cell_and_b_cell_immunodeficiency,
        :x_linked_recessive_disease ;
    :has_definition "A T cell deficiency that is characterized by CD4 lymphopenia, severe chronic viral infections, and defective T-lymphocyte activation in males and has_material_basis_in X-linked inheritance of mutations in the gene encoding magnesium transporter-1 (MAGT1)." ;
    :has_exact_synonym "XMEN"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:peripheral_nervous_system_benign_neoplasm rdfs:subClassOf :central_nervous_system_benign_neoplasm ;
    :has_definition "A central nervous system benign neoplasm the is located_in the peripheral nervous system." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autonomic_nervous_system_benign_neoplasm rdfs:subClassOf :peripheral_nervous_system_benign_neoplasm ;
    :has_definition "A peripheral nervous system benign neoplasm that is located_in the autonomic nervous system." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polycystic_kidney_disease rdfs:subClassOf :cystic_kidney_disease ;
    :has_definition "A cystic kidney disease that is characterized by the growth of fluid-filled cysts in the kidneys that reduces kidney function and may lead to kidney failure." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pancreatic_squamous_cell_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :pancreas ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :squamous_epithelial_cell ],
        :pancreatic_cancer,
        :squamous_cell_carcinoma ;
    :has_definition "A squamous cell carcinoma located in the pancreas." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tuberous_sclerosis_1 rdfs:subClassOf :tuberous_sclerosis ;
    :has_definition "A tuberous sclerosis that is characterized by hamartomas in multiple organ systems and has_material_basis_in heterozygous mutation in the TSC1 gene on chromosome 9q34." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tuberous_sclerosis_2 rdfs:subClassOf :tuberous_sclerosis ;
    :has_definition "A tuberous sclerosis that is characterized by hamartomas in multiple organ systems and has_material_basis_in autosomal dominant inheritance of heterozygous mutation in the TSC2 gene, which encodes tuberin, on chromosome 16p13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_hypertrophic_cardiomyopathy rdfs:subClassOf :hypertrophic_cardiomyopathy ;
    :has_definition "A hypertrophic cardiomyopathy that is characterized by thickening of the heart muscle and has_material_basis_in autosomal dominant inheritance of one or more gene mutations." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multinucleated_neurons_anhydramnios_renal_dysplasia_cerebellar_hypoplasia_and_hydranencephaly rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by severe hydranencephaly with almost complete absence of the cerebral hemispheres, which are replaced by fluid, relative preservation of the posterior fossa structures, and renal dysplasia or agenesis and has_material_basis_in autosomal recessive homozygous mutation in the CEP55 gene on chromosome 10q23." ;
    :has_exact_synonym "MARCH"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:culler_jones_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by hypopituitarism (mainly growth hormone deficiency), and/or postaxial polydactyly and has_material_basis_in autosomal dominant heterozygous mutation in the GLI2 gene on chromosome 2q14. Midline facial defects and developmental delay can also be seen. The condition shows incomplete penetrance and high variable expressivity." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cold_induced_sweating_syndrome_1 rdfs:subClassOf :cold_induced_sweating_syndrome ;
    :has_definition "A cold-induced sweating syndrome that has_material_basis_in homozygous or compound heterozygous mutation in the CRLF1 gene on chromosome 19p13 and is characterized in the neonatal period by orofacial weakness with impaired sucking and swallowing resulting in poor feeding necessitating medical intervention." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cold_induced_sweating_syndrome_2 rdfs:subClassOf :cold_induced_sweating_syndrome ;
    :has_definition "A cold-induced sweating syndrome that has_material_basis_in compound heterozygous mutation in the CLCF1 gene on chromosome 11q13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cold_induced_sweating_syndrome_3 rdfs:subClassOf :cold_induced_sweating_syndrome ;
    :has_definition "A cold-induced sweating syndrome that has_material_basis_in homozygous mutation in the KLHL7 gene on chromosome 7p15." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

