    :has_definition "An aortic valve disease that is characterized by the presence of abnormal two-leaflet aortic valve in at least 2 first-degree relatives." ;
    :has_exact_synonym "Familial bicuspid aortic valve"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aortic_valve_disease_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :bicuspid_aortic_valve_disease ;
    :has_definition "A bicuspid aortic valve disease that has_material_basis_in heterozygous mutation in the NOTCH1 gene on chromosome 9q34." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aortic_valve_disease_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :bicuspid_aortic_valve_disease ;
    :has_definition "A bicuspid aortic valve disease that has_material_basis_in heterozygous mutation in the SMAD6 gene on chromosome 15q22." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

