@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_dna_depletion_syndrome_15 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by severe intrauterine growth restriction, neonatal-onset hypoglycemia and liver dysfunction, mitochondrial DNA depletion in liver and skeletal muscle, and abnormal mitochondrial morphology observed in skeletal muscle, and has_material_basis_in autosomal recessive inheritance of homozygous mutation in the mitochondrial transcription factor A gene on chromosome 10q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_erythrocytosis_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
