@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_24 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in infancy of refactory seizures, severely impaired global development, intellectual disability, and behavioral abnormalities that has_material_basis_in heterozygous mutation in the HCN1 gene on chromosome 5p12." ;
    :has_exact_synonym "DEE24",
        "early infantile epileptic encephalopathy 24" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_65 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset in the first months to years of life of various types of intractable seizures, severe to profound psychomotor developmental delay, and mild facial dysmorphism that has_material_basis_in heterozygous mutation in the CYFIP2 gene on chromosome 5q33." ;
    :has_exact_synonym "DEE65",
        "early infantile epileptic encephalopathy 65" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_19 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset of seizures in the first year of life and mild to moderate impaired intellectual development that has_material_basis_in heterozygous mutation in the GABRA1 gene on chromosome 5q34." ;
    :has_exact_synonym "DEE19",
        "early infantile epileptic encephalopathy 19" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_60 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset of infantile spasms, seizures, or myoclonus in the first months of life, hypsarrhythmia on EEG, and severe global developmental delay that has_material_basis_in homozygous or compound heterozygous mutation in the CNPY3 gene on chromosome 6p." ;
    :has_exact_synonym "DEE60",
        "early infantile epileptic encephalopathy 60" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_51 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset of intractable seizures and hypotonia in the first days or weeks of life and severely delayed psychomotor development that has_material_basis_in homozygous or compound heterozygous mutation in the MDH2 gene on chromosome 7q11." ;
    :has_exact_synonym "DEE51",
        "early infantile epileptic encephalopathy 51" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_61 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy that has_material_basis_in homozygous or compound heterozygous mutation in the ADAM22 gene on chromosome 7q21." ;
    :has_exact_synonym "DEE61",
        "early infantile epileptic encephalopathy 61" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_37 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset of intractable seizures or abnormal movement in the first years of life and developmental delay or regression after seizure onset that has_material_basis_in homozygous or compound heterozygous mutation in the FRRS1L gene (604574) on chromosome 9q31." ;
    :has_exact_synonym "DEE37",
        "early infantile epileptic encephalopathy 37" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset of tonic seizures in early infancy and severely impaired psychomotor development that has_material_basis_in heterozygous mutation in the STXBP1 gene on chromosome 9q34.1." ;
    :has_exact_synonym "DEE4",
        "early infantile epileptic encephalopathy 4" .
